    // Group images by stable ID (e.g. last part like _16382)
    const groups = {};

    urlList.forEach(url => {
      const match = url.match(/(\d+_\d+)_.*_(\d)\.(jpg|jpeg|png)/i);
      if (match) {
        const groupId = match[1].split('_')[1]; // use only the second part as group ID
        const type = match[2]; // 1, 2, or 3
        if (!groups[groupId]) groups[groupId] = {};
        groups[groupId][type] = url;
      }
    });

    const allUsers = Object.values(groups);
    const user = allUsers[Math.floor(Math.random() * allUsers.length)];

    const container = document.getElementById("kyc-container");
    const row = document.createElement("div");
    row.className = "row";

    ['1', '2', '3'].forEach(i => {
      const img = document.createElement("img");
      img.src = user[i] || `https://via.placeholder.com/280x180?text=Missing+${i}`;
      img.loading = "lazy";
      row.appendChild(img);
    });

    container.appendChild(row);
  </script>
